import React from 'react';

const Frame70 = () => {
  return (
    <div
      style={{
        width: '1033px',
        height: '322px',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        margin: '0 auto',
        position: 'relative',
      }}
    >
      {/* Left: Text content placeholder */}
      <div style={{ flex: 1, height: '100%' }}>
        {/* Heading, subheading, description will go here */}
      </div>
      {/* Right: Illustration placeholder */}
      <div style={{ flex: 1, height: '100%', display: 'flex', justifyContent: 'flex-end', alignItems: 'center' }}>
        {/* Illustration/graphic will go here */}
      </div>
    </div>
  );
};

export default Frame70;
